import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNQE0RcpStvxnE8SjJ-DHzqUzF3DrIc203E0UloXnG_qVVD44hwB0LPCr0L6aQQ_WzXF8&usqp=CAU" />
    </header>
  );
};

export default Header;
